    ", it was the seventh-highest income county in the United States" /
      ", with a per capita personal income of " +
    "${budget.income}" +
    ". As of 2015, San Francisco" / " proper had a GDP of " +
    "${budget.gdp}" +
    ", and a GDP per capita of " +
    "${budget.capita}" +
    "."
  );
}

