export default function cleanSet(set, startString) {
  if (startString === undefined) {
    return '';
  }

  let result = '';
  for (const value of set) {
    if (value !== undefined && value.startsWith(startString)) {
      const suffix = value.substring(startString.length);
      result += result.length === 0 ? suffix : '-' + suffix;
    }
  }

  return result;
}

